import React from "react";
import "../components/website.css";

function homePage() {
  return (
    <div>
      <div className="navigation">
        <div className="sitename">
          <h2>Website Name</h2>
        </div>
        <div className="buttons">
          <div className="hmpbuttons">
            <button className="hmpbttn">Home</button>
            <button className="hmpbttn">Maket</button>
            <button className="hmpbttn">Profile</button>
          </div>
          <div className="lrbuttons">
            <button className="hmpbttn">Register</button>
            <button className="hmpbttn">Login</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default homePage;
